    [],nt"revision_timestamp": "2016-07-27T22:43:24.413727",nt"name": "the-trustees-of-reservations-piping-plover-research-and-protection-program-at-coskata-coat",nt"isopen":
    false,nt"url": null,nt"notes": "In 1994 eleven pairs of Piping Plovers
    (Charadrius melodus) were observed at the Coskata Coatue Wildlife Refuge, Nantucket,
    MA. Of the eleven, ten were observed during the standardized Atlantic coast index
    count and eight were identified as breeding pairs on the property. Overall the eight
    breeding pairs produced 11 nests, 23 chicks, and 9 fledglings or 1.1 fledgling per
    breeding pair. Nest failures in 1994 resulted from predation, 36% (4/11), and flooding
    by spring new moon high tides, .09% (1/11). Protection efforts in 1994 focused more
    attention on early season demarkation and protection of suitable nesting habitat
    with symbolic fencing and signs, and the use of predator exclosures at 27% (3/11)
    nest sites.  Use of exclosures in 1994 was successful with 100% (3/3) ofthe exclosed
    nests hatching. It is recommended that use of exclosures be extended in 1995 to
    include all nest attempts, with continued close monitoring of predator activity
    and the physical functioning of the exclosures. Chick mortality continued to be
    high on the site with just 39% (9 of 23) of the chicks hatched surviving to fledge.
    Vehicle restrictions continued in 1994 in compliance with theMassachusetts Department
    of Fisheries and Wildlife (MDFW) Guidelines for protection of Piping Plovers. The
    West beach of Great Point was closed on May 26, and the North half of the Galls
    and all of Great Point were closed totally to vehicle traffic June 17 through August
